import { Button } from '@material-ui/core'
import React from 'react'
import { Data } from '../../../Data'
import { Container, Wrapper, Content, Image } from './style'
function Card() {
    return (
        <Container>
            {Data.map((data) => (
                <Wrapper>
                    <Image background={data.imgUrl} />
                    <Content>
                        <h1>{data.title}</h1>
                        <Button
                            style={{ backgroundColor: 'black', color: 'white' }}
                        >
                            {' '}
                            Shop Now
                        </Button>
                    </Content>
                </Wrapper>
            ))}
        </Container>
    )
}

export default Card
